[PixAndVideo] Alexis Brill (A Proper Introduction / 200480 / 11.22.2014)

When a new member gets into the family, even if he is only a step-brother from the fresh marriage, the polite thing to do is to introduce himself to the family and get along well with the new family. Toby's dad get married with a woman after years of being single and all the sudden Toby's got a sexy new step-sister... so he introduced himself, quite properly.


